import { Link } from 'react-router-dom';
import './Error.css';

function Error() {
  return (
    <main className='error'>
      <h2 className='error__title'>404</h2>
      <p className='error__text'>Страница не найдена</p>
      <Link className='error__link' to='/'>Назад</Link>
    </main>
  )
}

export default Error;
